import React from 'react';
import Tribe from './assets/Tribe.png'
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';
// import Assignment1 from './Assignment1';
import Typography from '@mui/material/Typography';
import {ReactComponent as Hello} from './assets/Hello.svg'
import Hidden from '@mui/material/Hidden';


const Index = () => {
  return( 
    <>   
        <Grid container sm={12} padding={5} spacing={2}>
            <Grid item sm={4}  container justifyContent='center'>
                <img src={Tribe} alt='tribe' />
            </Grid>
            <Grid item sm={4} container justifyContent='center'>
                <Button variant='outlined' size='medium' sx={{color: 'white', background: '#407BFF'}}>Assignment 1</Button>
            </Grid>
            <Grid item sm={4} container justifyContent='center'>
                <Button variant='outlined' size='medium' sx={{color: 'white', background: '#407BFF'}}>Assignment 2</Button>
            </Grid>
            <Grid container sm={6}> 
                <Hello style={{width: '100%', minWidth: 350}} />
            </Grid>
            
                <Grid container sm={6}> 
                    <Grid style={{color: '#00004d', lineHeight: 'normal'}}>
                    <Typography variant='h1' style={{color: 'ButtonFace', marginTop: 30}}>Hello! ðŸ‘‹</Typography>
                    <Hidden smDown>
                        
                            <Typography variant='h3'>Shivam here... Full Stack Developer</Typography>
                            <Typography variant='h4'>This is a Assignment given by Invest With Tribe</Typography>
                            <Typography variant='h5'>Pls do check and you can follow me on linkedin</Typography>
                        
                    </Hidden>
                    </Grid>
                </Grid>
            
        </Grid>
    </>
    )
};

export default Index;
